import './App.css';

function App() {
  return (
    <div>
      <h1>Welcome to Easy Tracking!</h1>
      <p>Login Page</p>
      <Auth />

    </div>
  );
}

function Auth() {
  return (
    <form>
      <div>
        <label>Email: </label>
        <input type="email" placeholder='Please enter your Email' style={{ width: '200px', marginLeft: '23px'}} required />
      </div>
      <div>
        <label>Password: </label>
        <input type="password" placeholder='Please enter your Password' style={{ marginRight: '10px', width: '200px' }} required />
      </div>
    </form>
  )
}

function Auth2() {
  return (
  <form action="/submit" method="post">
    <label for="username">Username:</label>
    <input type="text" id="username" name="username" required />

    <label for="password">Password:</label>
    <input type="password" id="password" name="password" required />

    <button type="submit">Submit</button>
</form>
)
}

export default App;
